import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './CSS/Main.css'

import Homepage from './Pages/Homepage';
import Gemeinde from './Pages/Gemeinde';
import Neuigkeiten from './Pages/Neuigkeiten';
import Predigten from './Pages/Predigten';
import Konfliktloesung from './Pages/Konfliktloesung';
import Kontakt from './Pages/Kontakt';
import Impressum from './Pages/Impressum';

export default function Body(){
  return (
    <div className="content">
      <Routes>
        <Route exact path='/' element={<Homepage/>}></Route>
        <Route exact path='/gemeinde' element={<Gemeinde/>}></Route>
        <Route exact path='/neuigkeiten' element={<Neuigkeiten/>}></Route>
        <Route exact path='/predigten' element={<Predigten/>}></Route>
        <Route exact path='/konfliktloesung' element={<Konfliktloesung/>}></Route>
        <Route exact path='/kontakt' element={<Kontakt/>}></Route>
        <Route exact path='/impressum' element={<Impressum/>}></Route>
      </Routes>
    </div>
  );
}
